          "message": "Patch Set 1: Code-Review+1\n\n\u003e Patch Set 1: Code-Review+1\n\nAnil, if we only +1 patches, it blocks us from being able to merge the patch if we want to because of NACR. I think it would be better if we +2\u0027d patches that are not our own so that the team can merge the patch if they want to."
