            "comments": [
              {
                "file": "jjb/lf-python-jobs.yaml",
                "line": 57,
                "reviewer": ids["zxiiro"],
                "message": "Why are these things being archived? Most of them are Java / Maven output.",
                "patchSetTimestamp": 1520627123000
              },
              {
                "file": "jjb/lf-python-jobs.yaml",
                "line": 78,
                "reviewer": ids["zxiiro"],
                "message": "Instead of making people remember the entire filename it is better to let them select the version and have the code create the filename as it should be a well known name anyway.\n\nAlso parameterize the version {nexus-iq-cli-version} so that consumers can set the version they want in their Project definition.\n\nThis should probably go into the CLM anchor as well. as I wouldn\u0027t want to force ALL Python jobs to require NEXUS_IQ_CLI.",
                "patchSetTimestamp": 1520627123000
              },
              {
                "file": "jjb/lf-python-jobs.yaml",
                "line": 115,
                "reviewer": ids["zxiiro"],
                "message": "Just \"run-clm\" to keep it the same as the other CLM jobs. We don\u0027t want to make users learn different triggers for every job. If they are similar let\u0027s standardize on the same trigger.\n\nhttps://github.com/lfit/releng-global-jjb/blob/master/jjb/lf-maven-jobs.yaml#L176",
                "patchSetTimestamp": 1520627123000
              },
              {
                "file": "jjb/lf-python-jobs.yaml",
                "line": 143,
                "reviewer": ids["zxiiro"],
                "message": "Refer to the comment in the shell script file. Prefer we didn\u0027t use the credentials-binding and instead use CFP to place a file that can be deleted.",
                "patchSetTimestamp": 1520627123000
              },
              {
                "file": "jjb/lf-python-jobs.yaml",
                "line": 188,
                "reviewer": ids["zxiiro"],
                "message": "run-clm only please.",
                "patchSetTimestamp": 1520627123000
              },
              {
                "file": "shell/sonar-cli.sh",
                "line": 14,
                "reviewer": ids["zxiiro"],
                "message": "First line should always be straight to the point short summary. Then provide details in the body of the message. \"This script...\" is also a superfluous statement.\n\nSomething like the following is better:\n\n Perform a CLM scan of Python files\n \n Downloads nexus-iq-cli and uses it to perform an XC Evaluation\n or extended report to provide a CLM scan of Python code.",
                "patchSetTimestamp": 1520627123000
              },
              {
                "file": "shell/sonar-cli.sh",
                "line": 16,
                "reviewer": ids["zxiiro"],
                "message": "Call \"set +x\" right before the lines:\n\n set +x  # Prevent set -x from other scripts from printing passwords\n echo \"${CLM_USER}:${CLM_PASSWORD}\" ...\n java -jar ...",
                "patchSetTimestamp": 1520627123000
              },
              {
                "file": "shell/sonar-cli.sh",
                "line": 20,
                "reviewer": ids["zxiiro"],
                "message": "I\u0027d prefer if we didn\u0027t hardcode the URL. If this makes sense as a default then let\u0027s default but still allow it to be overrided.",
                "patchSetTimestamp": 1520627123000
              },
              {
                "file": "shell/sonar-cli.sh",
                "line": 21,
                "reviewer": ids["zxiiro"],
                "message": "If we\u0027re handling the cli-auth.txt in this way I would prefer we use CFP to place the cli-auth.txt file in an expected location. Use it in this script and immediately delete it. This way the credentials only exist on the system for as long as it is needed.\n\nUsing the credentials binding wrapper makes the 2 variables available to all scripts for the entire run of the Jenkins job.",
                "patchSetTimestamp": 1520627123000
              }
            ],
            "sizeInsertions": 189,
