                "reviewer": ids["zxiiro"],
                "message": "We should pick names with a prefix that all match to identify that it\u0027s for the lf-infra-trigger-parameterized-job macro. It is possible for a job to configure another one of these so we need to be able to differentiate which one is being called. How about:\n\n - para-trigger-condition\n - para-trigger-upstream-job-logs-url\n - para-trigger-job-to-trigger\n\nThe last one depends on if we want to allow the list of jobs or a single job.",
